import { Container } from "react-bootstrap";
import Nav from 'react-bootstrap/Nav';
import LandingPage from "./LandingPage";

function NavigationLinks() {
    const [showChat, setShowChat] = useState(false);
    return (

        <Container className="navigation-links-container">

            <Nav className="justify-content-center">
                <Nav.Item>
                    <Nav.Link href="/projects">My Favourite Projects</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link href="/talks">My Talks</Nav.Link>
                </Nav.Item>
            </Nav>
            <Nav className="justify-content-center">
                <Nav.Item>
                    <Nav.Link href="/projects">Talk to me virtually.</Nav.Link>
                    <button onClick={LandingPage.toggleChat}>
                        {showChat ? 'Hide Component' : 'Show Component'}
                    </button>
                </Nav.Item>
            </Nav>

        </Container>

    );
}

export default NavigationLinks;
